import React, { Component } from 'react';
import axios from 'axios'

class Api extends Component {
    state = { 
        userData:[],
        main:[],
        address:''
     }

    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/users')
        .then(response => {
            // console.log(response)
            this.setState({
                userData: response.data,
                main:response.data[5],
                address: response.data[5].address

            })
            console.log(this.state.userData)
            console.log(this.state.main)
            // console.log(this.state.address)

        })
        .catch(error => {
            console.log(error)
        })
    }

    render() { 
        let valueOne = this.state.userData
        let valueTwo = this.state.main
        let valueThree = this.state.address
        return ( 
            <div>
                <p>Title: {valueOne.name}</p>
        <p>body: {valueOne.url}</p>
        <p>Name: {valueTwo.name}</p>
        <p>email: {valueTwo.email}</p>
        <p>address: {valueThree.zipcode}</p>
            </div>
         );
    }
}

export default Api;
